import React from "react";

// @mui material components
import { Card, CardContent, Typography, Button, Grid } from "@mui/material";

// Material Dashboard 2 React components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import MDBox from "components/MDBox";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";

// Charts
import VerticalBarChart from "examples/Charts/BarCharts/VerticalBarChart";

// Content
import LastDonations from "layouts/trima/components/lastDonations";

// Data
import totalAferese from "layouts/dashboard/data/totalAferese";

function Trima() {
  const aferese = totalAferese();
  return (
    <DashboardLayout>
      <DashboardNavbar />
      <MDBox py={3}>
        <Grid container spacing={3}>
          <Grid item xs={12} md={8}>
            <Grid container spacing={3}>
              <Grid item xs={12} md={6} mb={3}>
                <VerticalBarChart
                  icon={{ color: "dark", component: "bloodtype" }}
                  title="Total de Plaquetas por Aférese Coletados"
                  description="Procedimentos por mês"
                  height="10rem"
                  chart={aferese}
                />
              </Grid>
              <Grid item xs={12} md={6} mb={3}>
                <VerticalBarChart
                  icon={{ color: "dark", component: "bloodtype" }}
                  title="Total de Plaquetas por Aférese Oferecidos "
                  description="Procedimentos por mês"
                  height="10rem"
                  chart={aferese}
                />
              </Grid>
              <Grid item xs={12} md={6} mb={3}>
                <VerticalBarChart
                  icon={{ color: "dark", component: "bloodtype" }}
                  title="Plaqueta Pré do Doador"
                  description="Procedimentos por mês"
                  height="10rem"
                  chart={aferese}
                />
              </Grid>
              <Grid item xs={12} md={6} mb={3}>
                <VerticalBarChart
                  icon={{ color: "dark", component: "bloodtype" }}
                  title="Hematócrito Pré do Doador"
                  description="Procedimentos por mês"
                  height="10rem"
                  chart={aferese}
                />
              </Grid>
              <Grid item xs={12} md={6} mb={3}>
                <VerticalBarChart
                  icon={{ color: "dark", component: "bloodtype" }}
                  title="Total de doações por Aféreses"
                  description="Procedimentos por mês"
                  height="8rem"
                  chart={aferese}
                />
              </Grid>
              <Grid item xs={12} md={6} mb={3}>
                <VerticalBarChart
                  icon={{ color: "dark", component: "bloodtype" }}
                  title="Total de doações por Aféreses"
                  description="Procedimentos por mês"
                  height="8rem"
                  chart={aferese}
                />
              </Grid>
            </Grid>
          </Grid>
          <Grid item xs={12} md={4}>
            <LastDonations />
          </Grid>
        </Grid>
      </MDBox>
    </DashboardLayout>
  );
}

export default Trima;
